import Tabuleiro from '../imagens/tabuleiro2.svg';
import "../Tela.css"


function Tabletop(){
    return(
        <div>
         <div>
            <Row>
             <Col className='justify-content-start'>
                    {/* <h3 className="titulo_login">
                    Meu tabuleiro
                 </h3> */}
             </Col>            
            </Row>

            <img src={Tabuleiro} alt='tabuleiro' className='tabuleiro pb-5'/>
         </div>
        </div>
    )
}
export default Tabletop
